/* 
SellerView get seller uploaded property an owner view 
*/

import { useEffect, useState } from 'react'; 

export default function SellerView () {
    const [propertyData, setPropertyData] = useState([]);
    const jwt = JSON.parse(localStorage.getItem("jwt")); 

    useEffect(() => {
        const getSellerProperty = async () => {
            try {
                const response = await fetch(
                    "http://127.0.0.1:8000/api/sell", 
                    {
                        method: "GET", 
                        headers: {
                            "Authorization": `JWT ${jwt.access}` 
                        }
                    }
                )
                const data = await response.json(); 
                setPropertyData(data); 
            } 
            catch (error) {
                console.log(error)
            }
        }

        getSellerProperty(); 

        console.log("propertyInfo")
        propertyData.map((propertyInfo) => (
            propertyInfo.images.map((image_url) => (
                console.log(image_url)
            ))
        ))


    },[])


    return (
        <div>
            <h1>Seller upload properties show up here</h1>
            {console.log(propertyData)}
        </div>
    )
}
